import React, { useState } from "react";
import "./ActivateUser.css";
import ReactSwipeButton from "react-swipe-button";

const MySlider = () => {
  const [isConfirmFadeOut, setIsConfrimFadeOut] = useState(false);
  const [isDeleteFadeOut, setIsDeleteFadeOut] = useState(true);

  const handleChange = () => {
    setIsConfrimFadeOut(true);
    setIsDeleteFadeOut(false);
  };
  const [state, setState] = useState({ x: 10, y: 10 });

  return (
    <div>
      <ReactSwipeButton text="SWIPE TO UNLOCK" color="yellow" />
    </div>
  );
};

export default MySlider;
